// navbar.jsx
import React from 'react';
import { BrowserRouter, Routes, Route, Link, Outlet } from 'react-router-dom';
import './Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';

// const Home = () => <div>Home</div>;
// const Galeria = () => <div>Gallery</div>;
// const ProductList = () => <div>Product List</div>;
// const Tablazat = () => <div>Tablazat</div>;
// const Clock = () => <div>Timer</div>;
// const Cart = () => <div>Cart</div>;
// const NoPage = () => <div>Page Not Found</div>;

const Layout = ({ children }) => (
  <>
    <nav className="navbar navbar-expand-lg navbar-dark navbar-custom">
      <Link to="/" className="navbar-brand">Your Brand</Link>
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarNav">
        <div className='nav-links'>
          <span>
            <Link to="/" className='nav-links-item'>Home</Link>
          </span>
          <span>
            <Link to="/galeria" className='nav-links-item'>Gallery</Link>
          </span>
          <span>
            <Link to="/productlist" className='nav-links-item'>Product List</Link>
          </span>
          <span>
            <Link to="/tablazat" className='nav-links-item'>Tablazat</Link>
          </span>
          <span>
            <Link to="/timer" className='nav-links-item'>Timer</Link>
          </span>
          <span>
            <Link to="/cart" className='nav-links-item'>Cart</Link>
          </span>
        </div>
      </div>
    </nav>
    {children}
  </>
);

function Navbar() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />
          <Route path="/galeria" element={<Galeria />} />
          <Route path="/productlist" element={<ProductList />} />
          <Route path="/tablazat" element={<Tablazat />} />
          <Route path="/timer" element={<Clock />} />
          <Route path="/cart" element={<Cart />} />
        </Route>
        <Route path="*" element={<NoPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default Navbar;
